import React from 'react'
import Manifest from './main-hero.json'
import Stadium from './main-hero.jpg'
import Boxing from '../boxing-ring.jpeg'

const CTA = () => {
    return (
        <div className='text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white'>Invest Now</div>
    )
}

const Hero = () => {
    return (
    <div className='relative flex flex-col h-screen justify-center items-center text-center text-white bg-black'>
        <div className='font-extrabold text-3xl flex-1 p-10'>{Manifest.motto}</div>
        <div className='flex-1'><CTA /></div>
        <img src={Boxing} alt='boxing' className='filter contrast-125 mix-blend-hard- object-cover bg-black'/>
    </div>
    )
}

export default Hero


